    gender:string,
    id:number,
    image:string,
    location:Array<string>,
    name:string,
    origin:Array<string>,
    species:string,
    status:string,
    type:string,
    url:string
}

export interface IInf{
    count:number,
    next:string,
    pages:number,
    prev:null
}


const Hooks = () =>{
    const [pod,setPod] = useState<IRes[]>([]);
